.team {
	max-width: 1170px;
	height: auto;
	margin: 114px auto;
	display: flex;
	flex-wrap: wrap;
	justify-content: center;
	@media screen and (min-width: 320px) and (max-width: 479px){
		flex-direction: column;
		align-content: center;
		margin-left: 25px;
	}
}
.team__item1 {
	width: 270px;
	height: 620px;
	margin-right: 30px;
	@media screen and (min-width: 480px) and (max-width: 1180px){
		width: 235px;
	}
	@media screen and (min-width: 320px) and (max-width: 479px){
		width: 280px;
	}

}
.team__item1:last-child{
	margin-right: 0px;
	@media screen and (min-width: 510px) and (max-width: 764px){
margin-right: 30px;
	}
}
.team__item1-img{
	width: 270px;
	height: 270px;
	@media screen and (min-width: 480px) and (max-width: 1180px){
		width: 235px;
		height: 235px;
	}
	@media screen and (min-width: 320px) and (max-width: 479px){
		width: 280px;

	}
}
